import axios from 'axios';

axios.interceptors.response.use(
  response => response,
  async error => console.log("error:", error)
);

const baseUrl = axios.create({baseURL: 'http://ec2-13-58-30-211.us-east-2.compute.amazonaws.com:8080'});

export const getEvent = (event) =>
  baseUrl.post(
  `http://localhost:8080/`
  );
